import React, {FormEvent, useState} from 'react';
import "./listboard.scss";
import {useDispatch} from "react-redux";
import * as actions from "../../../store/action/index"
const Listboard = () => {
    const [title,setTitle] = useState({
        title:""
    });
    let dispatch =  useDispatch();
    const changeValueTitle = (event:any) => {
        event.preventDefault();
        setTitle({...title,[event.target.name]: event.target.value})
    }
    const postTaskTitle = (event:FormEvent<HTMLFormElement>) =>{
        event.preventDefault();
        let action  =  actions.AddTask(title.title);
        dispatch(action);
    }

    return (
        <div className="containerListBoard">
            <form className="itemadd-task" onSubmit={(event)=>{postTaskTitle(event)}}>
                <input placeholder="add Task" name="title" onChange={(event)=>changeValueTitle(event)} />
            </form>
        </div>
    );
}

export default Listboard;
